window.bookSummaryJSON = "<p><b>Seven Brothers. Seven Brides. A revenge seven years in the making.</b></p> <p>Eight years ago, my family was betrayed by those closest to us. Now we’re back in Sabine Valley, staging our return during the feast of Lammas, where I step into the ring and ensure we’re given what we’re owed. Who we’re owed.</p> <p>Our enemies send their seven best warriors against me. With each victory, I win a Bride for each of my brothers. And for me? I’m saving the best for last. My Bride is Harlow, the woman claimed by the man I used to call friend - the one responsible for our exile. Eli.</p> <p>And if Eli has a problem with it? Well, then I’ll take him as my Bride, too. All the better to enact my revenge...and bring Sabine Valley to its knees.</p> <p>The Paine brothers are back, and we’re here to stay.</p> <p><i>In Abel, you’ll find:</i></p> <ul> <li><i>Friends to Enemies to Lovers</i></li> <li><i>Hate F*ck</i></li> <li><i>MMF Romance</i></li> <li><i>Marriage of Convenience x2</i></li> <li><i>Relationship in Trouble</i></li> <li><i>Sword-Cross Guarantee </i></li> </ul>"; 
